column8:
このセットでiPhone7やiPhone6Sなど、ライトニングケーブル対応のアップル機器が家庭用コンセントから充電できます。<BR>
セットに含まれるものは2つのUSBポートを備えたUSB-ACアダプタと、アップル認証のライトニングケーブル（20ｃｍ/1ｍ/2ｍのいずれかより選べます）の2点です。<style type="text/css">  
