<DIV class="enetama-bottom">
  <TABLE  class="enetama-bottom-teble"border="0">
    <TBODY>
      <TR>
        <TD class="enetama-left">商品名</TD>
        <TD class="enetama-right">iPhone7が充電できるセット</TD>
      </TR>
      <TR>
        <TD class="enetama-left">製品概要</TD>
        <TD class="enetama-right">アップル認証のライトニングケーブルとPSEマーク取得済みの安心USB-ACアダプタです。<br>
        このセットがあれば、家庭用のコンセントからiPhone7やiPhone6S,iPhone6等のLightning端子搭載アップル機器を充電できます。</TD>
      </TR>
    </TBODY>
  </TABLE>
</DIV>

<DIV class="enetama-bottom">
  <TABLE  class="enetama-bottom-teble"border="0">
    <TBODY>
      <TR>
        <TD class="enetama-left">セットに含まれる商品1</TD>
        <TD class="enetama-right">iPhone用タフネスLightningケーブル（20cm/1m/2mから選択）</TD>
      </TR>
      <TR>
        <TD class="enetama-left">長さ</TD>
        <TD class="enetama-right">20cm/1m/2ｍ(いずれも±10mm)からご選択ください</TD>
      </TR>
      <TR>
        <TD class="enetama-left">確認済み対応機種</TD>
        <TD class="enetama-right">iPhone7 iPhone7Plus iPhone6S iPhone6SPlus iPhone6 iPhone6Plus iPhone5S iPhone5C iPhone5
        等、Lightningケーブル（ライトニングケーブル）が使用できる機器</TD>
      </TR>
      <TR>
        <TD class="enetama-left">非対応機種</TD>
        <TD class="enetama-right">ケーブルが長くなるほどケーブル内での電力消耗が大きくなります。<br>
        その為、当ケーブルではiPad,iPadmini等、充電時の電力が多く必要な機器にはご使用いただくことができません。</TD>
      </TR>
      <TR>
        <TD class="enetama-left">特徴</TD>
        <TD class="enetama-right">電子基板とケーブルの接続部分を樹脂で固めてある為、ケーブルの断線のリスクを極限まで軽減しました。</TD>
      </TR>
      <TR>
        <TD class="enetama-left" bgcolor="#ff9999" style="background-color : #ff9999;">ご使用に関する注意</TD>
        <TD class="enetama-right"><FONT color="#ff0000">タフネスケーブルの端子内部の樹脂加工は、ハンダ付け等の接続部分の動きを抑制し、金属疲労による断線を起こさないようにするための加工です。<BR>
        iPhone、iPodからケーブルを抜く際には、一般的なケーブルと同様に、端子部分を持って引き抜いて下さい。<BR>
        <BR>
        外部張力による断線につきましては保証対象外とさせていただいております。<BR>
        絶対にケーブルを引っ張らないようご注意ください。<BR>
        充電ケーブルの取り外しは、必ず端子部分を持って引き抜いて下さい。</FONT></TD>
      </TR>
    </TBODY>
  </TABLE>
</DIV>
<DIV class="enetama-bottom">
  <TABLE  class="enetama-bottom-teble"border="0">
    <TBODY>
      <TR>
        <TD class="enetama-left">セットに含まれる商品2</TD>
        <TD class="enetama-right">コンセント用USB変換アダプタ/USB-ACアダプタ</TD>
      </TR>
      <TR>
        <TD class="enetama-left">外形寸法</TD>
        <TD class="enetama-right">薄さ：約13.3mm<br>
        縦幅：約74mm<br>
        横幅：約48mm<BR>重量：約45g</TD>
      </TR>
      <TR>
        <TD class="enetama-left">製品特徴</TD>
        <TD class="enetama-right">■ご家庭のコンセントをUSBに変換！ご家庭のコンセントからUSB充電ができたり、USB雑貨が使えるようになります。<br>
        ■270度可動式のコンセントプラグを備え、コンセント部の収納も可能<br>
        ■Max2.1Aの高出力で急速充電<br>
        ■USBを2ポート備え、同時使用もOK<br>
        ■薄さ僅か13.3ｍｍ！ポケットに入れて持ち運べるサイズ<br>
        ■シンプルな筐体は様々なお部屋の内装にマッチします<br>
        ■100ｖ-240ｖ　海外電圧対応<br>
        ■PSE取得済みの安全・安心設計</TD>
      </TR>
      <TR>
        <TD class="enetama-left">出力</TD>
        <TD class="enetama-right">5V<br>
        2.1A</TD>
      </TR>
      <TR>
        <TD class="enetama-left">出力に関するご注意</TD>
        <TD class="enetama-right">※1ポートのみご利用いただいた場合も、2ポート同時にご利用いただいた場合も、合計出力がMax2.1Aとなります。<br>
        合計1A以上の出力を要するタブレット端末などは2ポート同時ご利用時には充電できない場合がございます。<br>
        ※出力は充電される機器によって制御される場合がございます。また、ご使用いただくケーブルによっても出力できる値は変動します。一般的により細いケーブルやより長いケーブルは抵抗が大きくなります。</TD>
      </TR>
      <TR>
        <TD class="enetama-left">入力</TD>
        <TD class="enetama-right">100v-240v（海外電圧対応） <br>
        50Hz/60Hz</TD>
      </TR>
      <TR>
        <TD class="enetama-left">入力に関するご注意</TD>
        <TD class="enetama-right">※海外でご使用いただく場合には、現地のコンセントを日本式プラグ対応に変換するアダプタが別途必要となります。</TD>
      </TR>
      <TR>
        <TD class="enetama-left">その他のご注意</TD>
        <TD class="enetama-right">※各充電ケーブルは付属しておりませんので、別途ご用意下さい。<br>
        ※PCに接続した際にドライバ無しで充電できないケーブルはご利用頂く事が出来ません。充電機能が付いたケーブルをご利用下さい。<br>
        ※スマートフォンにてご利用頂く場合は、充電専用ケーブルをご用意ください。<br>
        ※充電時は本体が熱くなります。　ご使用上の問題はございませんが、本体の上に物（特に可燃性の物）等を置かないようにご注意ください。</TD>
      </TR>
    </TBODY>
  </TABLE>
</DIV>

